import React, { useState, useEffect } from 'react'
import { Modal, Badge, Form, Button } from 'react-bootstrap'
import { Rating } from 'react-simple-star-rating'
import { tooltipArray } from '@/mock/ratingData.js'
import UploaderWithList from './UploaderWithList'

interface propTypes {
  openModal: boolean
  setOpenModal: (params: boolean) => void
}
interface fileListType {
  id: string
  thumbnailUrl: string
  size: number
  type: string
  name: string
  url?: string
}

const ReviewRating = ({ openModal, setOpenModal }: propTypes): JSX.Element => {
  const [tooltip, setTooltip] = useState<boolean>(false)
  const [rating, setRating] = useState<number>(0)
  const [fileList, setFileList] = useState<fileListType[]>([])

  // modal close handler
  const handleClose = (): void => {
    setOpenModal(false)
  }

  // rating handler
  const handleRating = (rate: number): void => {
    setRating(rate)
  }

  // file list update handler it will update at delete time also
  const updateFilesHandler = (files: fileListType[]): void => {
    setFileList(files)
  }

  // for set a files initially use the below way
  useEffect(() => {
    setFileList([
      {
        id: 'wo85eduk',
        name: 'mipro-final.png',
        size: 32314,
        type: 'image/png',
        thumbnailUrl:
          'data:image/png;base64,',
      },
    ])
  }, [])

  return (
    <Modal centered show={openModal} onHide={handleClose} animation={false}>
      <Modal.Body className="py-4">
        <div className="review-product">
          <img src="/assets/images/products/02.png" />
          <div className="review-product-details">
            <h2 className="fs-6 mb-1">Nova NHT 1039 USB Trim....</h2>
            <div className="review-rating">
              <Badge bg="success" className="me-2">
                4
              </Badge>
              <span>(23,420)</span>
            </div>
          </div>
        </div>
        <Form>
          <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
            {/* <Form.Label>Title</Form.Label> */}
            <Form.Control type="text" className="text-dark" placeholder="Enter review title" />
          </Form.Group>
          <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
            {/* <Form.Label>Description</Form.Label> */}
            <Form.Control as="textarea" rows={3} placeholder="Enter review description..." />
          </Form.Group>
          <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
            <Form.Label>Rate the product</Form.Label>
            <div className="d-flex">
              <Rating
                size={34}
                allowFraction
                showTooltip={tooltip}
                onClick={handleRating}
                onPointerLeave={() => setTooltip(false)}
                onPointerEnter={() => setTooltip(true)}
                tooltipArray={tooltipArray}
              />
            </div>
          </Form.Group>
          <Form.Group controlId="formFileMultiple" className="mb-3">
            <Form.Label>Upload photo</Form.Label>
            <UploaderWithList column={3} getFiles={updateFilesHandler} loadFiles={fileList} />
          </Form.Group>
          <div>
            <Button className="btn btn-light btn-ecom me-2" onClick={handleClose}>
              Submit
            </Button>
            <Button variant="secondary" onClick={handleClose}>
              Close
            </Button>
          </div>
        </Form>
      </Modal.Body>
    </Modal>
  )
}

export default ReviewRating
